import logo from './logo.svg';
import './App.css';
import { useState, useEffect } from 'react';

function App() {
  const [imgs, setImgs] = useState([])

  useEffect(() => {
    fetch("http://localhost:3000/data-scrapper")
      .then((res) => res.json())
      .then((data) => setImgs(data))  
  }, [])

  return (
    <div>
      {imgs.result.map((img) => {
          <img src={img}></img>
        })
      }
    </div>
  );
}

export default App;
